description:
Kabluey (2007)  

Verenigde Staten
Komedie
86 minuten

geregisseerd door Scott Prendergast
met Scott Prendergast, Lisa Kudrow en Christine Taylor

De altijd onaangepaste Salman (Scott Prendergast) komt zijn schoonzus (Lisa Kudrow) te hulp, wanneer zijn broer naar Irak vertrekt om daar te vechten. Hij is gedwongen een vernederende baan te nemen als reusachtige blauwe bedrijfsmascotte om te kunnen blijven rondkomen.


